import React, {Component} from 'react';

class BookDetails extends Component {

    render() {
        const {books} = this.props.location;
        return (
            <div className="details">
                <p>{books.name}</p>
                <p>{books.description}</p>
            </div>
        );
    }
}

export default BookDetails;
